const types = [
    {
        name: "light rain",
        url: "../static/svg/rain.svg",
        color: "#C5C5C5",
        color2: "#858383",
    },
    {
        name: "scattered clouds",
        url: "../static/svg/clouds.svg",
        color: "#C5C5C5",
        color2: "#858383",
    },
    {
        name: "few clouds",
        url: "../static/svg/clouds.svg",
        color: "#C5C5C5",
        color2: "#858383",
    },
];
export default function ConvertSkies(sky) {
    const skyinfo = types.find((item) => {
        if (item.name === sky) return item;
    });
    console.log(skyinfo);
    if (!skyinfo) {
        return {
            name: "not found",
            url: null,
            color: "#C5C5C5",
            color2: "#858383",
        };
    }

    return skyinfo;
}
